import React from 'react'

class Event extends React.Component {
    render(){
        return(
            <div>
                <div className="event-card-image">
                    <img src={this.props.events.images}/>
                </div>
                <div className="event-card-details">
                    <h4>{this.props.events.name}</h4>
                    <p>{this.props.events.dates.start.localDate}</p>
                    <p>{this.props.events.priceRanges.max}</p>
                    <p><a href={this.props.seatmap.staticUrl}>Check Seat Map</a></p>
                </div>
            </div>
        )
    }
}

export default Event
